Collect a unified dataset for fiscal years 2018 and 2019 that captures the detailed NOTE6  OTHER LIABILITIES disclosures, including lineitem amounts for:  
- Current other liabilities and noncurrent other liabilities (and their total);  
- Other financial assets broken down by current and noncurrent components (derivatives, listed equity securities, investments in associates, loans to related parties, and total other financial assets);  
- Lease liabilities split into current and noncurrent portions (and total lease liabilities);  
- Cash, cash equivalents and marketable securities;  
- Total assets, total liabilities, and total noncurrent liabilities.  

The dataset should enable users to compute yearoveryear totals, averages across the two years, composition percentages (e.g., current liabilities as a share of total other liabilities, derivatives as a share of total other financial liabilities, lease liabilities as a share of total liabilities), and percentage changes between 2018 and 2019 for each line item.

